static const char __pyx_k_A_pathlib_compatible_interface[] = "\n    A pathlib-compatible interface for zip files.\n    Consider a zip file with this structure::\n        .\n        \342\224\234\342\224\200\342\224\200 a.txt\n        \342\224\224\342\224\200\342\224\200 b\n            \342\224\234\342\224\200\342\224\200 c.txt\n            \342\224\224\342\224\200\342\224\200 d\n                \342\224\224\342\224\200\342\224\200 e.txt\n    >>> data = io.BytesIO()\n    >>> zf = ZipFile(data, 'w')\n    >>> zf.writestr('a.txt', 'content of a')\n    >>> zf.writestr('b/c.txt', 'content of c')\n    >>> zf.writestr('b/d/e.txt', 'content of e')\n    >>> zf.filename = 'abcde.zip'\n    Path accepts the zipfile object itself or a filename\n    >>> root = Path(zf)\n    From there, several path operations are available.\n    Directory iteration (including the zip file itself):\n    >>> a, b = root.iterdir()\n    >>> a\n    Path('abcde.zip', 'a.txt')\n    >>> b\n    Path('abcde.zip', 'b/')\n    name property:\n    >>> b.name\n    'b'\n    join with divide operator:\n    >>> c = b / 'c.txt'\n    >>> c\n    Path('abcde.zip', 'b/c.txt')\n    >>> c.name\n    'c.txt'\n    Read text:\n    >>> c.read_text()\n    'content of c'\n    existence:\n    >>> c.exists()\n    True\n    >>> (b / 'missing.txt').exists()\n    False\n    Coercion to string:\n    >>> str(c)\n    'abcde.zip/b/c.txt'\n    ";
